" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 629px\">",
"   <div class=\"ttl\">",
"    Major pathways of cortisol metabolism",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 609px; height: 789px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The major pathways of hepatic metabolism of glucocorticoids involve enzymatic processing by 5&alpha; and 5&beta; reductases, 3&alpha; hydroxysteroid dehydrogenase, and 20&alpha; and 20&beta; hydroxysteroid dehydrogenases. The tetrahydrocortisols and tetrahydrocortisone are the most abundant urinary glucocorticoid metabolites - comprising, on average, 65 percent of total. The cortols and cortolones account for about 30 percent of total urinary glucocorticoid metabolites.",
"    <div class=\"footnotes\">",
