var title_f3_46_3822="ATPIII LDL goals";
var content_f3_46_3822=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F82504%7ECARD%2F67460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F82504%7ECARD%2F67460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ATP III LDL-cholesterol goals and cutpoints for therapeutic lifestyle changes and drug therapy in different risk categories",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Risk category",
"      </td>",
"      <td class=\"subtitle1\">",
"       LDL-cholesterol goal",
"      </td>",
"      <td class=\"subtitle1\">",
"       LDL-cholesterol level at which to initiate therapeutic lifestyle changes",
"      </td>",
"      <td class=\"subtitle1\">",
"       LDL-cholesterol level at which to consider drug therapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Coronary heart disease (CHD) or CHD risk equivalent (10-year risk &gt;20 percent)*",
"      </td>",
"      <td>",
"       &lt;100 mg/dL (2.58 mmol/L)",
"      </td>",
"      <td>",
"       &ge;100 mg/dL (2.58 mmol/L)",
"      </td>",
"      <td>",
"       &ge;130 mg/dL (3.36 mmol/L); drug optional at 100 to 129 mg/dL (2.58 to 3.33 mmol/L)&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2 or more risk factors (10-year risk &le;20 percent)&Delta;",
"      </td>",
"      <td>",
"       &le;130 mg/dL (3.36 mmol/L)",
"      </td>",
"      <td>",
"       &ge;130 mg/dL (3.36 mmol/L)",
"      </td>",
"      <td>",
"       10-year risk 10 to 20 percent: &gt;130 mg/dL (3.36 mmol/L) 10-year risk &lt;10 percent: &ge;160 mg/dL (4.13 mmol/L)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       0 to 1 risk factor&loz;",
"      </td>",
"      <td>",
"       &le;160 mg/dL (4.13 mmol/L)",
"      </td>",
"      <td>",
"       &ge;160 mg/dL (4.13 mmol/L)",
"      </td>",
"      <td>",
"       &ge;190 mg/dL (4.91 mmol/L); LDL-cholesterol lowering drug optional at 160 to 189 mg/dL (4.13 to 4.88 mmol/L)",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * CHD risk equivalents defined in text. 10-year risk defined by Framingham risk score (see text).",
"     <br>",
"      &bull; Some authorities recommend use of LDL-cholesterol lowering drugs in this category if LDL-cholesterol &lt;100 mg/dL (2.58 mmol/L) cannot be achieved by therapeutic lifestyle changes. Others prefer use of drugs that primarily modify triglycerides and HDL-cholesterol (eg, nicotinic acid or fibrate). Clinical judgement may also call for deferring drug therapy in this subcategory.",
"      <br>",
"       &Delta; Risk factors that modify LDL-cholesterol goals include cigarette smoking; hypertension (BP 140/90 mmHg or on antihypertensive medication); low HDL-cholesterol (&lt;40 mg/dL [1.03 mmol/L]); family history of premature CHD (CHD in male first degree relative &lt;55 years or CHD in female first degree relative &lt;65 years); age (men 45 years; women 55 years). HDL-cholesterol 60 mg/dL (1.55 mmol/L) counts as a negative risk factor; its presence removes one risk factor from the total count.",
"       <br>",
"        &loz; Almost all people with 0 to 1 risk factor have a 10-year risk &lt;10 percent; thus, 10-year risk assessment in people with 0 to 1 risk factor is not necessary.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Adult Treatment Panel III at file://www.nhlbi.nih.gov/.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed modifications of ATP III LDL-cholesterol goals and cutpoints for therapeutic lifestyle changes and drug therapy in different risk categories",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Risk category",
"       </td>",
"       <td class=\"subtitle1\">",
"        LDL goal",
"       </td>",
"       <td class=\"subtitle1\">",
"        LDL level at which to initiate therapeutic lifestyle changes",
"       </td>",
"       <td class=\"subtitle1\">",
"        LDL level at which to consider drug therapy*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         High risk:",
"        </strong>",
"        Coronary heart disease (CHD) or CHD risk equivalent (10-year risk &gt;20 percent)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        &lt;100 mg/dL (2.58 mmol/L); optional goal &lt;70 mg/dL (1.82 mmol/L) in very high risk",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        &ge;100 mg/dL (2.58 mmol/L)",
"        <sup>",
"         &loz;",
"        </sup>",
"        &ge;",
"       </td>",
"       <td>",
"        100 mg/dL (2.58 mmol/L)",
"        <sup>",
"         &sect;",
"        </sup>",
"        ; &lt;100 mg/dL (2.58 mmol/L) consider drug options",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Moderately high risk:",
"        </strong>",
"        2 or more risk factors (10-year risk 10 to 20 percent)",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        &lt;130 mg/dL (3.36 mmol/L)",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        &ge;130 mg/dL (3.36 mmol/L)",
"        <sup>",
"         &loz;",
"        </sup>",
"        &ge;",
"       </td>",
"       <td>",
"        &ge;130 mg/dL (3.36 mmol/L); 100 to 129 mg/dL consider drug options",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Moderate risk:",
"        </strong>",
"        2 or more risk factors (10-year risk &lt;10 percent)",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        &lt;130 mg/dL (3.36 mmol/L)",
"       </td>",
"       <td>",
"        &ge;130 mg/dL (3.36 mmol/L)",
"       </td>",
"       <td>",
"        &ge;160 mg/dL (4.13 mmol/L)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Lower risk:",
"        </strong>",
"        0 to 1 risk factor**",
"       </td>",
"       <td>",
"        &lt;160 mg/dL (4.13 mmol/L)",
"       </td>",
"       <td>",
"        &ge;160 mg/dL (4.13 mmol/L)",
"       </td>",
"       <td>",
"        &ge;190 mg/dL (4.91 mmol/L); 160 to 189 mg/dL consider drug options",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * When LDL lowering drug therapy is given, it is advised that the intensity of therapy be sufficient to achieve at least a 30 to 40 percent reduction in LDL levels.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     CHD risk equivalents include noncoronary forms of atherosclerotic disease (peripheral arterial disease, abdominal aortic aneurysm, and carotid artery disease), and diabetes. Ten-year risk defined by modified Framingham risk score.",
"     <br/>",
"     &Delta; Very high risk favors the optional LDL goal of &lt;70 mg/dL (1.82 mmol/L) and, in patients with high triglycerides, non-HDL cholesterol goal of &lt;100 mg/dL.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     &ge; Any individual at high or moderately high risk who has lifestyle-related risk factors (eg, obesity, physical inactivity, hypertriglyceridemia, low HDL-cholesterol [&lt;40 mg/dL (1.04 mmol/L)], or metabolic syndrome is a candidate for therapeutic lifestyle changes to modify these risk factors independent of LDL level.",
"     <br/>",
"     &sect; If baseline LDL is &lt;100 mg/dL (2.58 mmol/L), institution of an LDL lowering drug is an option. This can be combined with a fibrate or nicotinic acid if a high-risk person has hypertriglyceridemia or low HDL (&lt;40 mg/dL (1.04 mmol/L).",
"     <br/>",
"     &yen; Risk factors that modify LDL goals include cigarette smoking; hypertension (BP &ge;140/90 mmHg or on antihypertensive medication)s; low HDL-cholesterol (&lt;40 mg/dL [1.03 mmol/L]); family history of premature CHD (CHD in male first degree relative &lt;55 years or CHD in female first degree relative &lt;65 years); age (men &ge;45 years; women &ge;55 years). HDL-cholesterol &ge;60 mg/dL (1.55 mmol/L) counts as a negative risk factor; its presence removes one risk factor from the total count.",
"     <br/>",
"     &Dagger; Optional LDL goal &lt;100 mg/dL (2.58 mmol/L).",
"     <br/>",
"     &dagger; For moderately high risk persons with LDL of 100 to 129 mg/dL (2.58 to 3.35 mmol/L) at baseline or after lifestyle changes, initiation of an LDL lowering drug to achieve an LDL &lt;100 mg/L is an option.",
"     <br/>",
"     ** Almost all people with 0 to 1 risk factor have a 10-year risk &lt;10 percent; thus, 10-year risk assessment in people with 0 to 1 risk factor is not necessary.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Third report of the National Cholesterol Education Program (NCEP) Expert Panel on detection, evaluation, and treatment of high blood cholesterol in adults (Adult Treatment Panel III). Circulation 2002; 106:3143; with modifications from Grundy SM, Cleeman JI, Merz CN, et al, Circulation 2004; 110:227.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
